On Escalation Ticket # 00432792 the new comment has been added: Robert-Zoltan Sumi:

@WaitingOnEngineer  Hi Botond, for some sites (like Wetransfer) the file upload destination is different than the site where the upload request was made. For such cases we include also the Origin in the CAP logs, so Destination details will be something like: "wt-prod-euwest1-storm.s3.eu-west-1.amazonaws.com (Origin: https://wetransfer.com)". We created a test build with this modificaton:

smb://192.168.14.5/public/groups/_daily_builds/CoSoSys/2025-builds/2025_02_12/EppClient_v6.2.4.0066

@Cristian-Alexandru Halmajan please create a download link.

